import './App.css';
import { createTheme, ThemeProvider } from '@material-ui/core/styles';
import navBar from './components/navBar';

const theme = createTheme({
  palette: {
    primary: {
      main: "#141414"
    },
    secondary: {
      main: "#f1f0ec"
    }
  },
  // typography: {
  //   fontFamily: "BrownStdRegular"
  // }
});

function App() {
  return (
    <div className="App">
      <ThemeProvider theme={theme}>

      </ThemeProvider>
    </div>
  );
}

export default App;
